import React from "react";
import NavigationPage from "./NavigationPage";
import { Link } from "react-router-dom";

class HomePage extends React.Component {
    constructor(props) {
        super();
    }

    render() {
        return (
            <div>
                <NavigationPage></NavigationPage>
                <ul>
                    <li>Introduction to ReactJS</li>
                    <li>Class vs Functional Component</li>
                    <li><Link to="props-demo">Props in ReactJS</Link></li>
                    <li><Link to="props-demo">State in React JS</Link></li>
                    <li><Link to="props-demo">Life Cycle of React Component</Link></li>
                    <li>React Router Overview</li>
                    <li>React Redux Overview</li>
                    <li><Link to="http://localhost:3000">Demo of ReactJS Based Web Application</Link></li>
                    <li>Q&A</li>
                </ul>
            </div>
        );
    }

}

export default HomePage;
